		console.log(wdIndex, userId, jwt);
		const result = await CustomPost({
			url: `/web/bookMarkList/${userId}`,
			body: {
				companyDuty_no: `${wdIndex}`,
			},
			headers: {
				'x-access-token': jwt,
			},
		});
		console.log(result);
		// switch (result.code) {
